  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Maritime NWR (including the Alaska Peninsula Unit, the Aleutian Islands Unit, the
  Bering Sea Unit, the Chukchi Sea Unit, and the Gulf of Alaska Unit) outlines Refuge
  accomplishments during the 1990 calendar year. The report includes a planning section
  which discusses the master plan, management planning, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, manpower programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, grazing, fire management, and wilderness
  areas. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, fisheries resources, scientific collections, animal
  control, marking and bird banding, and disease control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, computer systems, and energy conservation. Economic uses of the Refuge
  and items of interest are provided at the end. Brochures are attached.\",\n\t\"license_title\":
